const INITIAL_STATE = {
    cartProducts: [],
}

export function CartReducer(state = INITIAL_STATE, action) {
    switch (action.type) {
        case 'ADD_PRODUCT':
            return {
                ...state,
                cartProducts: [...state.cartProducts, action.cartProducts]
            }
    }
}
